import React, { Component } from 'react'



export class NavProfile extends Component {
  render() {
    return (
      <div className="navProfile-box-container">
          <div className="navProfile-text">
              this is the nav list component bra!
        </div>
      </div>
    )
  }
}

export default NavProfile;
